import React, { Component } from 'react'
import { NavLink } from 'react-router-dom'
import { connect } from 'react-redux'


class NavBar extends Component {
    render() {
        const showNAv = () => {
            if (this.props.loggeduser !== undefined) {
                return (
                    <ul>

                        <li>
                            <NavLink to='/Home/:id' exact activeClassName='active'>
                                Home
                            </NavLink>
                        </li>
                        <li>
                            <NavLink to='/questions' activeClassName='active'>
                                question
                            </NavLink>
                        </li>
                        <li>
                            <NavLink to='/leaderboard' activeClassName='active'>
                                leaderboard
                            </NavLink>
                        </li>
                        <li>
                            <NavLink to='/add' activeClassName='active'>
                                new question
                            </NavLink>
                        </li>
                        <li>
                            welcome {this.props.loggeduser.name}
                        </li>
                    </ul>
                )

            }

        }
        return (
            <div>
                {showNAv()}
            </div>
        )
    }


}
const mapStateToProps = (state) => {
    console.log("navbar1", state.login.users)
    console.log("navbar2", state.login.loggeduser)

    return {

        users: state.login.users,
        loggeduser: state.login.loggeduser,

    }
}
export default connect(mapStateToProps)(NavBar);
